import React from 'react';
import './styles.scss';

const About = () => {
  return (
    <section className="about" id="about">
      <div className="container">
        <h2 className="section-title">About Me</h2>
        <div className="about__content">
          <div className="about__text">
            <p>Seorang mahasiswa Teknik Informatika dengan passion dalam pengembangan web. Memiliki pengalaman dalam membangun aplikasi web menggunakan React.js dan Node.js. Selalu bersemangat untuk mempelajari teknologi baru dan berkolaborasi dalam tim.</p>
            <p>Saat ini fokus pada pengembangan aplikasi web modern dengan performa tinggi dan user experience yang baik. Tertarik pada teknologi frontend dan backend development.</p>
          </div>
          <div className="about__image">
            <img src="/images/profile.jpg" alt="Ruhiyatna Rahman" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
